&lt;p&gt;Make a Promise to yourself today and begin a commitment to your health for life with Yourself!Fitness. Maya, the Yourself!Fitness personal trainer, will help you choose your health and fitness goals and then she will work with you to achieve them. Maya will guide you through workouts featuring Aerobics, Pilates, Strength Training Technique, Yoga, Guided Meditation and Relaxation exercises giving you step-by-step coaching from warm-up to cool-down. &lt;p/&gt;
